import React from 'react';
import './ServicesPage.css'; // Ensure this path points to your CSS file

const Services = () => {
    const services = [
        { title: "Strategic Marketing", description: "Crafting strategies to put your brand ahead in the game." },
        { title: "Social Media Management", description: "Your brand, trending across all platforms with style." },
        { title: "Search Engine Optimization (SEO)", description: "Boost your online swagger! We'll spruce up your website so Google has no choice but to be your biggest fan." },
        { title: "Creative Design", description: "From logos to ad campaigns, we make ideas come alive." },
        { title: "Technical Solutions", description: "Tech-savvy fixes to keep your business running smoothly." },
        { title: "Automation Services", description: "Streamline operations with cutting-edge automation." },
        { title: "Brand Pitching", description: "Create compelling pitches that resonate and convert." },
        { title: "Sales/Leads", description: "Proven strategies to drive growth and generate leads." },
        { title: "Video Editing", description: "Captivating stories told through stunning visuals." },
        { title: "Website Development", description: "Modern, responsive websites tailored to your brand." },
        { title: "Application Development", description: "Mobile apps that captivate and perform." },
        { title: "Software Development", description: "Custom software solutions for your unique needs." },
        { title: "Hosting Solutions", description: "Reliable hosting for your digital presence." },
        { title: "Video Campaign Delivery", description: "End-to-end management of impactful video campaigns." },
    ];

    return (
        <section id="services" className="services-page">
            <div className="services-content">
                <h2>Our Services</h2>
                <div className="service-container">
                    {services.map((service, index) => (
                        <div className="service-item" key={index}>
                            <h3>{service.title}</h3>
                            <p>{service.description}</p>
                        </div>
                    ))}
                </div>
            </div>
        </section>
    );
};

export default Services;
